import './login.css';
import React, { useState } from 'react';
import axios from 'axios';

const LoginForm = () => {
    const [formData, setFormData] = useState({ email: '', password: '' });
    const [errors, setErrors] = useState({});
    const [output, setOutput] = useState('');

    // Handle input change
    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

  // Validate form fields
  const validateForm = () => {
    const newErrors = {};
    const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/; // Regex for email format

    if (!formData.email) {
      newErrors.email = 'Email is required';
    } else if (!emailRegex.test(formData.email)) {
      newErrors.email = 'Invalid email format';
    }

    if (!formData.password) {
      newErrors.password = 'Password is required';
    }

    return newErrors;
  };

  // Handle form submission
  const handleSubmit = async (e) => {
        e.preventDefault();
        const validationErrors = validateForm();
        if (Object.keys(validationErrors).length > 0) {
            setErrors(validationErrors);
            return;
        }

        try {
            const response = await axios.post('http://localhost:5000/api/auth/login', formData);
            setOutput('Login successful!');
            setFormData({
                email: '',
                password: ''
              });
            console.log(response.data);
        } catch (error) {
            setOutput('Login failed!');
        }
    };

  return (
    <> 
<div className="form-group col-12"> 



</div>

    <div className="form-container">
      <form onSubmit={handleSubmit} className="form-card">
        <h2 className="form-heading">Login</h2>
        
        <div className="form-group">
          <label htmlFor="email" className="form-label">Email:</label>
          <input
            type="email"
            className={`form-control ${errors.email ? 'is-invalid' : ''}`}
            id="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            placeholder="Enter your email"
          />
        </div>
        {errors.email && <span className="ErrorMessage">{errors.email}</span>}

        <div className="form-group">
          <label htmlFor="password" className="form-label">Password:</label>
          <input
            type="password"
            className={`form-control ${errors.password ? 'is-invalid' : ''}`}
            id="password"
            name="password"
            value={formData.password}
            onChange={handleChange}
            placeholder="Enter your password"
          />
        </div>
        {errors.password && <span id="error" className="ErrorMessage">{errors.password}</span>}

        <div className="row">

        <div className="col-12">
      <a href='#'>Forget Password   </a>
        {/* <button type="submit" className="btn btn-primary submit-btn">Forgat Password</button> */}
      </div>
      <div className="col-12">
        
        <button type="submit"    className="btn btn-primary submit-btn">Submit</button>
      </div>
      <hr></hr>

      <div className="col-12">
        
        <button type="submit" className="btn btn-primary submit-btn"> Sing In With Google </button>
      </div>
    </div>

    {output && (
      <div className="row mt-3">
        <div className="col-12">
            <a href='#'></a>
          <div className="output-message">{output}</div>
        </div>
      </div>
    )}
      </form>
    </div>
    </>
  );
};



export default LoginForm;


